"use strict";

function f_gold(s) {
    let words = s.split(" ");
    let m = words.length;
    let n = Math.max(...words.map(word => word.length));
    let ans = [];
    for (let j = 0; j < n; j++) {
        let t = [];
        for (let i = 0; i < m; i++) {
            let word = words[i];
            t.push(j < word.length ? word[j] : " ");
        }
        ans.push(t.join("").trimEnd());
    }
    return ans;
}
